window.bookSummaryJSON = "<p><b>Darker and dirtier than ever before. Best-selling author Trilina Pucci brings you an alpha hero, Dominic King, that breaks the mold. Get ready to swoon over this instalove story.</b></p> <p>The moment I saw her, I wanted her. I just didn't expect to want to keep her. But then she walked away. She should've known better. I'm not the kind of man you turn your back on. I'm ruthless, powerful, and unforgiving.</p> <p>Something she'll soon find out.</p> <p>I will own her. Body and soul. Consume her while she begs for it. What started as one night will become forever. And I'll destroy anyone that gets in my way.</p> <p>Drew Matthews is mine.</p> <p><b>Contains mature themes.</b></p>"; 
